import React, { Component } from "react";
import "./Station.scss";
import { connect } from "react-redux";

class Station extends Component {
  render() {
    return (
      <div>
        <h1 className="genres-heading">Radio Stations</h1>
        <div className="row align-items-end">
          <span className="col-6 font-weight-bold">
            {/* {this.props.artistsData.length + "  Results"} */}
          </span>
          <div className="col-12">
            <hr />
          </div>
        </div>
        <div className="row">
          <div className="col-xl-2 col-lg-3 col-sm-4 col-6 pb-4">
            <div className="custom-card">
              <div className="custom-card--img">
                <div>
                  <img
                    src={data.artistImage}
                    alt="artist-img"
                    className="art-image"
                  />
                </div>
                <div className="custom-card--link mt-2">
                  <h6 className="mb-0 artist-font">{data.artistName}</h6>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
const MapStateToProps = (state) => ({
  artistsData: state.home.featureArtists,
});

export default connect(MapStateToProps, {
  featureArtists,
})(Station);
